import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const MainPage = () => {
  const navigate = useNavigate();

  const handleCreateStack = () => {
    // Perform logic to create stack
    // After creating the stack, navigate to the stack detail page
    navigate('/stack-detail/:id'); // Replace :id with the ID of the newly created stack
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Welcome to ChatGPT</h1>
      <p style={styles.subtitle}>Build and run your own AI-powered chatbots</p>
      <div style={styles.actions}>
        <button onClick={handleCreateStack} style={styles.button}>Create New Stack</button>
        <Link to="/stacks" style={styles.link}>Show Previous Stacks</Link>
      </div>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px',
    textAlign: 'center',
  },
  title: {
    fontSize: '2.5em',
    fontWeight: 'bold',
    marginBottom: '10px',
    color: '#333',
  },
  subtitle: {
    fontSize: '1.2em',
    color: '#666',
    marginBottom: '20px',
  },
  actions: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  button: {
    padding: '15px 30px',
    fontSize: '1.2em',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
    transition: 'background-color 0.3s',
  },
  buttonHover: {
    backgroundColor: '#0056b3',
  },
  link: {
    textDecoration: 'none',
    color: '#007bff',
    fontSize: '1.2em',
  },
};

export default MainPage;
